var SystemBillingJScripts = function() {

    var globalURLSystemBilling = 'http://localhost/easybilling/';
    
        var LoadData = function() {
            $('#systembilling-form-datainvoice').submit(function(event){
                //alert('enviar form');
                var data = new FormData(this);
                $.ajax({
                    url: globalURLSystemBilling + 'systemBilling/dataBilling/',
                    data: data,
                    processData: false,
                    contentType: false,
                    type: 'POST',
                    beforeSend: function(){
                        //alert('Verificar los datos del video que se registra');
                    },
                    success: function(resultado){
                        alert(resultado);
                        /*setTimeout(function(e){
                            window.location = globalURLCDMesaGConnection + 'adminvideostore';
                            e.preventDefault();
                        },3000);*/
                    }
                });
            event.preventDefault();              
            });
        };
    
	return {
		init: function() {
			LoadData()
		}
	}
}();
jQuery(document).ready(function() {
	SystemBillingJScripts.init()
});